import axios from 'axios';
import React from 'react';

const baseURL = "http://52.10.102.239/tickets/";

const ressource = axios.get(baseURL);

class App extends React.Component {
  state = {
    tickets: []
  }

  componentDidMount() {
    axios.get(baseURL)
      .then(res => {
        const tickets = res.data;
        this.setState({ tickets });
      })
  }

  render() {
    return (
        <ul>
          {
            this.state.tickets
              .map(ticket => 
                <React.Fragment>
                  <li>{ticket.id}</li>
                  <li>{ticket.email}</li>
                </React.Fragment>
              )
          }
        </ul>
      
    )
  }
}


